// All Owner & User , Business List

exports.AllOwnerAndUserAndBusinessOfBranchList = function (req, res) {
  var ReceivingData = req.body;
  if (!ReceivingData.Owner || ReceivingData.Owner === '') {
    res.status(417).send({ Status: false, Message: "Owner Details can not be empty" });
  } else {
    ReceivingData.Owner = mongoose.Types.ObjectId(ReceivingData.Owner);
    Promise.all([
      CustomerManagement.CustomerSchema.findOne({ _id: ReceivingData.User, ActiveStatus: true, IfDeleted: false }, {}, {}).exec(),
    ]).then(ResponseNew => {
      var CustomerDetails = JSON.parse(JSON.stringify(ResponseNew[0]));
      var BranchArr = [];
      var BusinessArr = [];
      var FindQuery = {};
      var InviteFindQuery = {};
      var TemporaryFindQuery = {};
      var InvoiceFindQuery = {};
      if (typeof ReceivingData.User === 'object' && ReceivingData.User !== null && ReceivingData.User !== undefined && CustomerDetails.BusinessAndBranches.length !== 0 && typeof ReceivingData.Business === 'object' && ReceivingData.Business !== null && ReceivingData.Business !== undefined) {
        ReceivingData.Business = mongoose.Types.ObjectId(ReceivingData.Business._id);
        CustomerDetails.BusinessAndBranches.map(Obj => {
          Obj.Branches.map(obj => {
            BranchArr.push(mongoose.Types.ObjectId(obj));
          });
        });

        FindQuery = { _id: { $in: BranchArr }, Business: ReceivingData.Business, UserAssigned: true };
        InviteFindQuery = {
          $or: [
            { $and: [{ Branch: { $in: BranchArr } }, { Business: ReceivingData.Business }] },
            { $and: [{ BuyerBranch: { $in: BranchArr } }, { BuyerBusiness: ReceivingData.Business }] },],
          Invite_Status: "Accept"
        };
        TemporaryFindQuery = {
          $or: [
            { $and: [{ Branch: { $in: BranchArr } }, { Business: ReceivingData.Business }] },
            { $and: [{ BuyerBranch: { $in: BranchArr } }, { BuyerBusiness: ReceivingData.Business }] },
          ],
          Request_Status: "Accept"
        };
        InvoiceFindQuery = {
          $or: [
            { $and: [{ Branch: { $in: BranchArr } }, { Business: ReceivingData.Business }] },
            { $and: [{ BuyerBranch: { $in: BranchArr } }, { BuyerBusiness: ReceivingData.Business }] },],
          InvoiceStatus: "Accept"
        };
      } else if (typeof ReceivingData.User === 'object' && ReceivingData.User !== null && ReceivingData.User !== undefined &&
        (ReceivingData.Business === null || ReceivingData.Business === undefined)) {
        CustomerDetails.BusinessAndBranches.map(Obj => {
          BusinessArr.push(Obj.Business);
          Obj.Branches.map(obj => {
            BranchArr.push(mongoose.Types.ObjectId(obj));
          });
        });
        FindQuery = { _id: { $in: BranchArr }, UserAssigned: true };
        InviteFindQuery = {
          $or: [
            { $and: [{ Branch: { $in: BranchArr } }, { Business: ReceivingData.Business }] },
            { $and: [{ BuyerBranch: { $in: BranchArr } }, { BuyerBusiness: ReceivingData.Business }] },],
          Invite_Status: "Accept"
        };
        TemporaryFindQuery = {
          $or: [
            { $and: [{ Branch: { $in: BranchArr } }, { Business: ReceivingData.Business }] },
            { $and: [{ BuyerBranch: { $in: BranchArr } }, { BuyerBusiness: ReceivingData.Business }] },],
          Request_Status: "Accept"
        };
        InvoiceFindQuery = {
          $or: [
            { $and: [{ Branch: { $in: BranchArr } }, { Business: ReceivingData.Business }] },
            { $and: [{ BuyerBranch: { $in: BranchArr } }, { BuyerBusiness: ReceivingData.Business }] },],
          InvoiceStatus: "Accept"
        };
      } else if (typeof ReceivingData.Business === 'object' && ReceivingData.Business !== null && ReceivingData.Business !== undefined && (ReceivingData.User === null || ReceivingData.User === undefined)) {
        ReceivingData.Business = mongoose.Types.ObjectId(ReceivingData.Business._id);
        FindQuery = { Business: ReceivingData.Business };
        InviteFindQuery = {
          $or: [{ Business: ReceivingData.Business }, { BuyerBusiness: ReceivingData.Business }],
          Invite_Status: "Accept"
        };
        TemporaryFindQuery = {
          $or: [{ Business: ReceivingData.Business }, { BuyerBusiness: ReceivingData.Business }],
          Request_Status: "Accept"
        };
        InvoiceFindQuery = {
          $or: [{ Business: ReceivingData.Business }, { BuyerBusiness: ReceivingData.Business }],
          InvoiceStatus: "Accept"
        };
      } else {
        FindQuery = { Customer: ReceivingData.Owner };
        InviteFindQuery = {
          $or: [{ Buyer: ReceivingData.Owner }, { Seller: ReceivingData.Owner }],
          Invite_Status: "Accept"
        };
        TemporaryFindQuery = {
          $or: [{ Buyer: ReceivingData.Owner }, { Seller: ReceivingData.Owner }],
          Request_Status: "Accept"
        };
        InvoiceFindQuery = {
          $or: [{ Buyer: ReceivingData.Owner }, { Seller: ReceivingData.Owner }],
          InvoiceStatus: "Accept"
        };
      }
      const Skip_Count = parseInt(ReceivingData.Skip_Count, 0) || 0;
      const Limit_Count = parseInt(ReceivingData.Limit_Count, 0) || 5;
      var ShortOrder = { createdAt: -1 };
      var ShortKey = ReceivingData.ShortKey;
      var ShortCondition = ReceivingData.ShortCondition;
      if (ShortKey && ShortKey !== null && ShortKey !== '' && ShortCondition && ShortCondition !== null && ShortCondition !== '') {
        ShortOrder = {};
        ShortOrder[ShortKey] = ShortCondition === 'Ascending' ? 1 : -1;
      }

      var AdvancedFindQuery = {};
      if (ReceivingData.FilterQuery && typeof ReceivingData.FilterQuery === 'object' && ReceivingData.FilterQuery !== null && ReceivingData.FilterQuery.length > 0) {
        ReceivingData.FilterQuery.map(obj => {
          if (obj.Type === 'String') {
            FindQuery[obj.DBName] = { $regex: new RegExp(".*" + obj.Value + ".*", "i") };
          }
          if (obj.Type === 'Select') {
            FindQuery[obj.DBName] = obj.Value;
          }
          if (obj.Type === 'Date') {
            if (FindQuery[obj.DBName] === undefined) {
              FindQuery[obj.DBName] = obj.Option === 'LTE' ? { $lt: new Date(new Date(obj.Value).setDate(new Date(obj.Value).getDate() + 1)) } : obj.Option === 'GTE' ? { $gte: new Date(obj.Value) } : new Date(obj.Value);
            } else {
              const DBName = obj.DBName;
              const AndQuery = obj.Option === 'LTE' ? { $lt: new Date(new Date(obj.Value).setDate(new Date(obj.Value).getDate() + 1)) } : obj.Option === 'GTE' ? { $gte: new Date(obj.Value) } : new Date(obj.Value);
              FindQuery['$and'] = [{ [DBName]: FindQuery[obj.DBName] }, { [DBName]: AndQuery }];
            }
          }
          if (obj.Type === 'Object') {
            FindQuery[obj.DBName] = mongoose.Types.ObjectId(obj.Value._id);
          }
          if (obj.Type === 'Object' && obj.DBName === '_id') {
            if (typeof obj.Value === 'object') {
              AdvancedFindQuery['_id'] = mongoose.Types.ObjectId(obj.Value._id);
            }
          }
        });
      }
      Promise.all([
        BusinessManagement.BranchSchema
          .aggregate([
            { $match: FindQuery },
            { $addFields: { BranchNameSort: { $toLower: "$BranchName" } } },
            { $addFields: { MobileSort: { $toLower: "$Mobile" } } },
            { $addFields: { AddressSort: { $toLower: "$Address" } } },
            { $addFields: { RegistrationIdSort: { $toLower: "$RegistrationId" } } },
            { $addFields: { AvailableCreditLimitSort: { $toLower: "$AvailableCreditLimit" } } },
            { $addFields: { BranchCreditLimitSort: { $toLower: "$BranchCreditLimit" } } },
            {
              $project: {
                _id: 1,
                BranchName: 1,
                Mobile: 1,
                RegistrationId: 1,
                AvailableCreditLimit: 1,
                BranchCreditLimit: 1,
                GSTIN: 1,
                ActiveStatus: 1,
                IfDeleted: 1,
                createdAt: 1,
                updatedAt: 1
              }
            },
            { $match: AdvancedFindQuery },
            { $sort: ShortOrder },
            { $skip: Skip_Count },
            { $limit: Limit_Count }
          ]).exec(),
        BusinessManagement.BranchSchema.countDocuments(FindQuery).exec(),
        InviteManagement.InviteManagementSchema.find(InviteFindQuery, {}, {}).exec(),
        TemporaryDetails.CreditSchema.find(TemporaryFindQuery, {}, {}).exec(),
        InvoiceManagement.InvoiceSchema.find(InvoiceFindQuery, {}, {}).exec(),
      ]).then(Response => {
        var BranchDetails = JSON.parse(JSON.stringify(Response[0]));
        var BranchCount = JSON.parse(JSON.stringify(Response[1]));
        var InviteDetails = JSON.parse(JSON.stringify(Response[2]));
        var TemporaryDetails = JSON.parse(JSON.stringify(Response[3]));
        var InvoiceDetails = JSON.parse(JSON.stringify(Response[4]));
        var TodayDate = new Date();
        TodayDate = new Date(TodayDate.setHours(0, 0, 0, 0));
        BranchDetails.map(objBranch => {
          objBranch.ExtraUnitizedCreditLimit = 0;
          const InviteDetailsArr = InviteDetails.filter(obj1 => obj1.BuyerBranch === objBranch._id && obj1.ActiveStatus === true);
          if (InviteDetailsArr.length > 0) {
            var ValidityDate = new Date();
            InviteDetailsArr.map(objIn => {
              ValidityDate = new Date(objIn.updatedAt);
              ValidityDate = new Date(ValidityDate.setDate(ValidityDate.getDate() + objIn.BuyerPaymentCycle));
              objBranch.BranchCreditLimit = parseFloat(objBranch.BranchCreditLimit) + parseFloat(objIn.AvailableLimit);
              objBranch.AvailableCreditLimit = parseFloat(objBranch.AvailableCreditLimit) + parseFloat(objIn.AvailableLimit);
            });
          }

          const TemporaryDetailsArr = TemporaryDetails.filter(obj1 => obj1.BuyerBranch === objBranch._id && obj1.ActiveStatus === true);
          if (TemporaryDetailsArr.length > 0) {
            var ValidityDate = new Date();
            TemporaryDetailsArr.map(objTemp => {
              ValidityDate = new Date(objTemp.updatedAt);
              ValidityDate = new Date(ValidityDate.setDate(ValidityDate.getDate() + objTemp.ApprovedPeriod));
              if (ValidityDate.valueOf() >= TodayDate.valueOf()) {
                objBranch.BranchCreditLimit = parseFloat(objBranch.BranchCreditLimit) + parseFloat(objTemp.ApproveLimit);
                objBranch.AvailableCreditLimit = parseFloat(objBranch.AvailableCreditLimit) + parseFloat(objTemp.ApproveLimit);
              }
            });
          }

          const InvoiceDetailsArr = InvoiceDetails.filter(obj1 => (obj1.BuyerBranch === objBranch._id && obj1.ActiveStatus === true) || (obj1.Branch === objBranch._id && obj1.ActiveStatus === true));
          if (InvoiceDetailsArr.length > 0) {
            var InvoiceAmount = 0;
            InvoiceDetailsArr.map(objInvoice => {
              InvoiceAmount = parseFloat(InvoiceAmount) + parseFloat(objInvoice.AvailableAmount);
            });

            if (InvoiceAmount > 0) {
              objBranch.AvailableCreditLimit = parseFloat(objBranch.AvailableCreditLimit) - parseFloat(InvoiceAmount);
              if (objBranch.AvailableCreditLimit > 0) {
                objBranch.AvailableCreditLimit = parseFloat(objBranch.AvailableCreditLimit);
              } else {
                objBranch.ExtraUnitizedCreditLimit = parseFloat(objBranch.AvailableCreditLimit);
                objBranch.ExtraUnitizedCreditLimit = objBranch.ExtraUnitizedCreditLimit.toFixed(2);
                objBranch.ExtraUnitizedCreditLimit = parseFloat(objBranch.ExtraUnitizedCreditLimit);
                objBranch.AvailableCreditLimit = 0;

              }
            }
          }

          objBranch.AvailableCreditLimit = objBranch.AvailableCreditLimit.toFixed(2);
          objBranch.AvailableCreditLimit = parseFloat(objBranch.AvailableCreditLimit);
          objBranch.BranchCreditLimit = objBranch.BranchCreditLimit.toFixed(2);
          objBranch.BranchCreditLimit = parseFloat(objBranch.BranchCreditLimit);
          return objBranch;
        });
        res.status(200).send({ Status: true, Message: "Branch List!.", Response: BranchDetails, SubResponse: BranchCount });
      }).catch(ErrorRes => {
        ErrorHandling.ErrorLogCreation(req, 'Business Details Find error', 'CustomerManagement -> BusinessDetails', JSON.stringify(ErrorRes));
        res.status(417).send({ Status: false, Message: "Some error occurred!.", Error: ErrorRes });
      });

    }).catch(Error => {
      res.status(417).send({ Status: false, Message: "Some Occurred Error!.", Error: Error });
    });
  }
};

// Invoice Management List----------------------
exports.InvoiceManagementList = function (req, res) {
  var ReceivingData = req.body;
  if (!ReceivingData.Owner || ReceivingData.Owner === '') {
    res.status(417).send({ Status: false, Message: "Owner Details can not be empty" });
  } else {
    ReceivingData.Owner = mongoose.Types.ObjectId(ReceivingData.Owner);
    const Skip_Count = parseInt(ReceivingData.Skip_Count, 0) || 0;
    const Limit_Count = parseInt(ReceivingData.Limit_Count, 0) || 5;
    var ShortOrder = { createdAt: -1 };
    var ShortKey = ReceivingData.ShortKey;
    var ShortCondition = ReceivingData.ShortCondition;
    if (ShortKey && ShortKey !== null && ShortKey !== '' && ShortCondition && ShortCondition !== null && ShortCondition !== '') {
      ShortOrder = {};
      ShortOrder[ShortKey] = ShortCondition === 'Ascending' ? 1 : -1;
    }

    var FindQuery = {};
    if (typeof ReceivingData.User === 'object' &&
      ReceivingData.User !== undefined && ReceivingData.User !== null &&
      typeof ReceivingData.Business === 'object' &&
      ReceivingData.Business !== null &&
      ReceivingData.Business !== undefined &&
      typeof ReceivingData.Branch === 'object' &&
      ReceivingData.Branch !== undefined &&
      ReceivingData.Branch !== null) {
      ReceivingData.User = mongoose.Types.ObjectId(ReceivingData.User.Owner);
      ReceivingData.Business = mongoose.Types.ObjectId(ReceivingData.Business._id);
      ReceivingData.Branch = mongoose.Types.ObjectId(ReceivingData.Branch._id);
      FindQuery = {
        'IfDeleted': false,
        $or: [{
          $and: [{ Buyer: mongoose.Types.ObjectId(ReceivingData.Owner) },
          { BuyerBusiness: mongoose.Types.ObjectId(ReceivingData.Business) },
          { BuyerBranch: mongoose.Types.ObjectId(ReceivingData.Branch) }]
        },
        {
          $and: [{ Seller: mongoose.Types.ObjectId(ReceivingData.Owner) },
          { Business: mongoose.Types.ObjectId(ReceivingData.Business) },
          { Branch: mongoose.Types.ObjectId(ReceivingData.Branch) }],
        }]
      };
    } else if ((typeof ReceivingData.User === 'object' &&
      ReceivingData.User !== undefined && ReceivingData.User !== null && typeof ReceivingData.Business === 'object'
      && ReceivingData.Business !== null && ReceivingData.Business !== undefined
      && (ReceivingData.Branch === undefined || ReceivingData.Branch === null))) {
      ReceivingData.User = mongoose.Types.ObjectId(ReceivingData.User.Owner);
      ReceivingData.Business = mongoose.Types.ObjectId(ReceivingData.Business._id);
      FindQuery = {
        'IfDeleted': false,
        $or: [{
          $and: [{ Buyer: mongoose.Types.ObjectId(ReceivingData.User) },
          { BuyerBusiness: mongoose.Types.ObjectId(ReceivingData.Business) }]
        },
        {
          $and: [{ Seller: mongoose.Types.ObjectId(ReceivingData.User) },
          { Business: mongoose.Types.ObjectId(ReceivingData.Business) }],
        }]
      };
    } else if (typeof ReceivingData.Branch === 'object' && ReceivingData.Branch !== null &&
      ReceivingData.Branch !== undefined && typeof ReceivingData.User === 'object' &&
      ReceivingData.User !== undefined && ReceivingData.User !== null &&
      (ReceivingData.Business === undefined || ReceivingData.Branch === null)) {
      ReceivingData.User = mongoose.Types.ObjectId(ReceivingData.User.Owner);
      ReceivingData.Branch = mongoose.Types.ObjectId(ReceivingData.Branch._id);
      FindQuery = {
        'IfDeleted': false,
        $or: [{
          $and: [{ Buyer: mongoose.Types.ObjectId(ReceivingData.User) },
          { BuyerBranch: mongoose.Types.ObjectId(ReceivingData.Branch) }]
        },
        {
          $and: [{ Seller: mongoose.Types.ObjectId(ReceivingData.User) },
          { Branch: mongoose.Types.ObjectId(ReceivingData.Branch) }],
        }]
      };
    } else if (typeof ReceivingData.Business === 'object' &&
      ReceivingData.Business !== null && ReceivingData.Business !== undefined
      && typeof ReceivingData.Branch === 'object' && ReceivingData.Branch !== null &&
      ReceivingData.Branch !== undefined && (ReceivingData.User === null || ReceivingData.User === undefined)) {
      ReceivingData.Business = mongoose.Types.ObjectId(ReceivingData.Business._id);
      ReceivingData.Branch = mongoose.Types.ObjectId(ReceivingData.Branch._id);
      FindQuery = {
        'IfDeleted': false,
        $or: [{
          $and: [{ BuyerBusiness: mongoose.Types.ObjectId(ReceivingData.Business) },
          { BuyerBranch: mongoose.Types.ObjectId(ReceivingData.Branch) }]
        },
        {
          $and: [{ Business: mongoose.Types.ObjectId(ReceivingData.Business) },
          { Branch: mongoose.Types.ObjectId(ReceivingData.Branch) }],
        }]
      };
    } else if (typeof ReceivingData.User === 'object' && ReceivingData.User !== undefined && ReceivingData.User !== null &&
      (ReceivingData.Business === null || ReceivingData.Business === undefined) &&
      (ReceivingData.Branch === null || ReceivingData.Branch === undefined)) {
      ReceivingData.User = mongoose.Types.ObjectId(ReceivingData.User.Owner);
      FindQuery = {
        'IfDeleted': false,
        $or: [{ Buyer: mongoose.Types.ObjectId(ReceivingData.User) }, { Seller: mongoose.Types.ObjectId(ReceivingData.User) }]
      }
    } else if (typeof ReceivingData.Business === 'object' && ReceivingData.Business !== undefined && ReceivingData.Business !== null &&
      (ReceivingData.Branch === null || ReceivingData.Branch === undefined) && (ReceivingData.User === null || ReceivingData.User === undefined)) {
      ReceivingData.Business = mongoose.Types.ObjectId(ReceivingData.Business._id);
      FindQuery = {
        'IfDeleted': false,
        $or: [{ BuyerBusiness: mongoose.Types.ObjectId(ReceivingData.Business) },
        { Business: mongoose.Types.ObjectId(ReceivingData.Business) }]
      };
    } else if (typeof ReceivingData.Branch === 'object' && ReceivingData.User !== undefined && ReceivingData.User !== null &&
      (ReceivingData.Business === null || ReceivingData.Business === undefined) &&
      (ReceivingData.User === null || ReceivingData.User === undefined)) {
      ReceivingData.Branch = mongoose.Types.ObjectId(ReceivingData.Branch._id);
      FindQuery = {
        'IfDeleted': false,
        $or: [{ BuyerBranch: mongoose.Types.ObjectId(ReceivingData.Branch) },
        { Branch: mongoose.Types.ObjectId(ReceivingData.Branch) }]
      };
    } else {
      FindQuery = {
        'IfDeleted': false,
        $or: [{ Buyer: mongoose.Types.ObjectId(ReceivingData.Owner) }, { Seller: mongoose.Types.ObjectId(ReceivingData.Owner) }]
      }
    }

    if (ReceivingData.FilterQuery && typeof ReceivingData.FilterQuery === 'object' && ReceivingData.FilterQuery !== null && ReceivingData.FilterQuery.length > 0) {
      ReceivingData.FilterQuery.map(obj => {
        if (obj.Type === 'String') {
          FindQuery[obj.DBName] = { $regex: new RegExp(".*" + obj.Value + ".*", "i") };
        }
        if (obj.Type === 'Select') {
          FindQuery[obj.DBName] = obj.Value;
        }
        if (obj.Type === 'Date') {
          if (FindQuery[obj.DBName] === undefined) {
            FindQuery[obj.DBName] = obj.Option === 'LTE' ? { $lt: new Date(new Date(obj.Value).setDate(new Date(obj.Value).getDate() + 1)) } : obj.Option === 'GTE' ? { $gte: new Date(obj.Value) } : new Date(obj.Value);
          } else {
            const DBName = obj.DBName;
            const AndQuery = obj.Option === 'LTE' ? { $lt: new Date(new Date(obj.Value).setDate(new Date(obj.Value).getDate() + 1)) } : obj.Option === 'GTE' ? { $gte: new Date(obj.Value) } : new Date(obj.Value);
            FindQuery['$and'] = [{ [DBName]: FindQuery[obj.DBName] }, { [DBName]: AndQuery }];
          }
        }
        if (obj.Type === 'Object') {
          FindQuery[obj.DBName] = mongoose.Types.ObjectId(obj.Value._id);
        }
      });
    }
    Promise.all([
      InvoiceManagement.InvoiceSchema
        .aggregate([
          { $match: FindQuery },
          {
            $lookup: {
              from: "Customers",
              let: { "seller": "$Seller" },
              pipeline: [
                { $match: { $expr: { $eq: ["$$seller", "$_id"] } } },
                {
                  $project: {
                    'ContactName': 1,
                  }
                }
              ],
              as: 'SellerInfo'
            }
          },
          { $unwind: { path: "$SellerInfo", preserveNullAndEmptyArrays: true } },
          {
            $lookup: {
              from: "Customers",
              let: { "buyer": "$Buyer" },
              pipeline: [
                { $match: { $expr: { $eq: ["$$buyer", "$_id"] } } },
                {
                  $project: {
                    'ContactName': 1,
                  }
                }
              ],
              as: 'BuyerInfo'
            }
          },
          { $unwind: { path: "$BuyerInfo", preserveNullAndEmptyArrays: true } },
          {
            $lookup: {
              from: "Business",
              let: { "business": "$Business" },
              pipeline: [
                { $match: { $expr: { $eq: ["$$business", "$_id"] } } },
                {
                  $project: {
                    'FirstName': 1,
                    'LastName': 1,
                  }
                }
              ],
              as: 'BusinessInfo'
            }
          },
          { $unwind: { path: "$BusinessInfo", preserveNullAndEmptyArrays: true } },
          {
            $lookup: {
              from: "Business",
              let: { "buyerBusiness": "$BuyerBusiness" },
              pipeline: [
                { $match: { $expr: { $eq: ["$$buyerBusiness", "$_id"] } } },
                {
                  $project: {
                    'FirstName': 1,
                    'LastName': 1,
                  }
                }
              ],
              as: 'BuyerBusinessInfo'
            }
          },
          { $unwind: { path: "$BuyerBusinessInfo", preserveNullAndEmptyArrays: true } },
          // {
          //   $lookup: {
          //     from: "Branch",
          //     let: { "branch": "$Branch" },
          //     pipeline: [
          //       { $match: { $expr: { $eq: ["$$branch", "$_id"] } } },
          //       {
          //         $project: {
          //           'BranchName': 1,
          //         }
          //       }
          //     ],
          //     as: 'BranchInfo'
          //   }
          // },
          // { $unwind: { path: "$BranchInfo", preserveNullAndEmptyArrays: true } },
          // {
          //   $lookup: {
          //     from: "Branch",
          //     let: { "buyerBranch": "$BuyerBranch" },
          //     pipeline: [
          //       { $match: { $expr: { $eq: ["$$buyerBranch", "$_id"] } } },
          //       {
          //         $project: {
          //           'BranchName': 1,
          //         }
          //       }
          //     ],
          //     as: 'BuyerBranchInfo'
          //   }
          // },
          // { $unwind: { path: "$BuyerBranchInfo", preserveNullAndEmptyArrays: true } },
          { $addFields: { InvoiceNumberSort: { $toLower: "$InvoiceNumber" } } },
          { $addFields: { InvoiceDateSort: { $toLower: "$InvoiceDate" } } },
          { $addFields: { InvoiceAmountSort: { $toLower: "$InvoiceAmount" } } },
          {
            $project: {
              SellerInfo: 1,
              BuyerInfo: 1,
              BusinessInfo: 1,
              // BranchInfo: 1,
              InvoiceNumber: 1,
              BuyerBusinessInfo: 1,
              // BuyerBranchInfo: 1,
              InvoiceDate: 1,
              InvoiceAmount: 1,
              InvoiceStatus: 1,
              InvoiceDescription: 1,
              InvoiceAttachments: 1,
              ActiveStatus: 1,
              IfDeleted: 1,
              createdAt: 1,
              updatedAt: 1
            }
          },
          { $sort: ShortOrder },
          { $skip: Skip_Count },
          { $limit: Limit_Count }
        ]).exec(),
      InvoiceManagement.InvoiceSchema.countDocuments(FindQuery).exec()
    ]).then(Response => {
      Response[0] = JSON.parse(JSON.stringify(Response[0]));
      res.status(200).send({ Status: true, Message: "Invoice List!.", Response: Response[0], SubResponse: Response[1] });
    }).catch(ErrorRes => {
      ErrorHandling.ErrorLogCreation(req, 'Invoice Details Find error', 'CustomerManagement -> BusinessDetails', JSON.stringify(ErrorRes));
      res.status(417).send({ Status: false, Message: "Some error occurred!.", Error: ErrorRes });
    });
  }
};

